import React from "react";
import { NavLink } from "react-router-dom";
import Row from "react-bootstrap/Row";
function Menu() {
  return (
    <>
      <div className="d-flex flex-row justify-end">
        <NavLink activeClassName="active" exact to="/">
          Az oldalról
        </NavLink>

        <NavLink activeClassName="active" exact to="/info">
          Komposztinfó
        </NavLink>

        <NavLink activeClassName="active" to="/gyik">
          Gy.I.K.
        </NavLink>
        <NavLink activeClassName="active" exact to="/map">
          Komposzt Térkép
        </NavLink>
      </div>
      <div className="d-flex justify-content-end">
        <div className="p-2 col-example text-left">Flex item 1</div>
        <div className="p-2 col-example text-left">Flex item 2</div>
        <div className="p-2 col-example text-left">Flex item 3</div>
      </div>
    </>
  );
}

export default Menu;
